// components/Home.js
import React from 'react';

const Home = () => {
  return (
    <div>
      <h1>Witamy w Aplikacji do Rezerwacji Tematów Prac Dyplomowych</h1>
      <p>Możesz zarejestrować nowy temat lub zarezerwować istniejący.</p>
    </div>
  );
};

export default Home;
